import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    { id: "e1", title: "Car", amount: 297.45, date: new Date(2021, 2, 28) },
    { id: "e2", title: "Bike", amount: 597.45, date: new Date(2021, 12, 2) },
    { id: "e3", title: "Cycle", amount: 397.45, date: new Date(2021, 4, 9) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is visible too.</p>
      <Expenses expenses={expenses[0]} />
      <Expenses expenses={expenses[1]} />
      <Expenses expenses={expenses[2]} />
    </div>
  );
}

export default App;
